export type GenericModalProps = {
  title: string | React.ReactNode;
  body: React.ReactNode;
  withoutBodyPadding?: boolean;
  footer?: React.ReactNode;
  onClose: () => void;
};

const useStyles = makeStyles({
  modal: {
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    overflowY: 'scroll',
    background: fade(theme.colors.overlay.color, theme.colors.overlay.opacity),
  },

  paper: {
    position: (props: { smallHeight: boolean }) =>
      props.smallHeight ? 'relative' : 'absolute',
    top: (props: { smallHeight: boolean }) =>
      props.smallHeight ? 'unset' : '121px',
    minWidth: '500px',
    width: (props: { smallHeight: boolean }) =>
      props.smallHeight ? '500px' : 'inherit',
    backgroundColor: theme.colors.white,
    borderRadius: '8px',
    boxShadow: `0 0 ${theme.colors.shadow.opacity} 0 ${theme.colors.shadow.color}`,

    '&:focus': {
      outline: 'none',
    },
  },
});

const GenericModal = ({
  body,
  footer,
  onClose,
  title,
  withoutBodyPadding,
  smallHeight,
}: GenericModalProps & { smallHeight: boolean }) => {
  const classes = useStyles({ smallHeight });

  return (
    <Modal open className={classes.modal}>
      <div className={cn(classes.paper)}>
        <TitleSection>
          <Title size="xs" withoutMargin>
            {title}
          </Title>
          <StyledButton onClick={onClose}>
            <Icon size="sm" type="cross" />
          </StyledButton>
        </TitleSection>

        <BodySection
          withoutBodyPadding={withoutBodyPadding}
          smallHeight={smallHeight}>
          {body}
        </BodySection>

        {footer && <FooterSection>{footer}</FooterSection>}
      </div>
    </Modal>
  );
};

const MediaModal = (props: GenericModalProps): React.ReactElement => (
  <Media query={{ maxHeight: 500 }}>
    {(matches) => <GenericModal {...props} smallHeight={matches} />}
  </Media>
);

export default MediaModal;
import React, { useState } from 'react';
import styled from 'styled-components';
import { Divider } from '../../../index';

import {
  GenericModal,
  Icon,
  Text,
  Button,
  Switch,
  ModalFooterConfirmation,
} from '../../../index';

const SearchInput = styled.input`
  border: none;
  background-color: transparent;
  box-shadow: none;
  font-family: ${({ theme }) => theme.fonts.fontFamily};
  width: 250px;

  :focus {
    outline: none;
  }
`;

const BodyHeader = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  border-bottom: 2px solid ${({ theme }) => theme.colors.separator};
  padding: 0 24px;
`;

const SearchContainer = styled.div`
  display: flex;
  align-items: center;
  height: 52px;
  border-right: 2px solid ${({ theme }) => theme.colors.separator};
`;

const StyledItem = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 0px 24px;
  height: 51px;
  border-bottom: 2px solid ${({ theme }) => theme.colors.separator};

  :last-child {
    border-bottom: 0px;
  }
`;

const StyledImage = styled.img`
  width: 26px;
  height: 26px;
  object-fit: contain;
  margin: 0 16px 0 0;
`;

const StyledImageName = styled.div`
  display: flex;
  align-items: center;
`;

const FormContainer = styled.div`
  display: flex;
  align-items: center;
  padding: 24px;
`;

const TextDesc = styled(Text)`
  width: 350px;
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
`;

const UnstyledButton = styled.button`
  background: none;
  color: inherit;
  border: none;
  cursor: pointer;
  padding: 0;
  outline-color: ${({ theme }) => theme.colors.separator};
`;

const StyledDivider = styled(Divider)`
  height: 30px;
`;

type Props = {
  title?: string;
  defaultIconUrl: string;
  showDeleteButton?: boolean;
  itemList: Array<{
    id: number | string;
    iconUrl: string;
    name: string;
    description?: string;
    checked: boolean;
    isDeletable?: boolean;
  }>;
  addButtonLabel?: string;
  formBody: React.ReactNode;
  isSubmitFormDisabled?: boolean;
  onSubmitForm: () => void;
  onItemToggle: (itemId: number | string, checked: boolean) => void;
  onItemDeleted?: (itemId: number | string) => void;
  onClose: () => void;
};

const ManageList = ({
  title = 'Manage List',
  itemList,
  showDeleteButton,
  defaultIconUrl,
  formBody,
  addButtonLabel = 'add',
  isSubmitFormDisabled = false,
  onSubmitForm,
  onItemToggle,
  onItemDeleted,
  onClose,
}: Props): JSX.Element => {
  const [search, setSearch] = useState('');
  const [isFormMode, setIsFormMode] = useState(false);

  const setDefaultImage = (e: React.SyntheticEvent<HTMLImageElement>): void => {
    (e.target as HTMLImageElement).onerror = null;
    (e.target as HTMLImageElement).src = defaultIconUrl;
  };

  const getFilteredItemList = () => {
    if (!search || !search.length) {
      return itemList;
    }

    return itemList.filter(
      (i) =>
        i.name.toLowerCase().includes(search.toLowerCase()) ||
        i.description?.toLowerCase().includes(search.toLowerCase())
    );
  };

  const getBody = () => {
    return isFormMode ? (
      <FormContainer>{formBody}</FormContainer>
    ) : (
      <>
        <BodyHeader>
          <SearchContainer>
            <Icon size="md" type="search" />
            <SearchInput
              onChange={(event) => setSearch(event.target.value)}
              placeholder="Search"
              value={search}
            />
          </SearchContainer>
          <Button
            size="md"
            color="primary"
            variant="contained"
            onClick={() => setIsFormMode(!isFormMode)}>
            <Text size="lg" color="white">
              + {addButtonLabel}
            </Text>
          </Button>
        </BodyHeader>
        <div>
          {getFilteredItemList().map((i) => {
            const onChange = (checked: boolean) => onItemToggle(i.id, checked);
            const onDeleteClick = () => onItemDeleted?.(i.id);

            return (
              <StyledItem key={i.id}>
                {/* Item description */}
                <StyledImageName>
                  <StyledImage
                    alt={i.name}
                    onError={setDefaultImage}
                    src={i.iconUrl}
                  />
                  <div>
                    <div>
                      <Text size="lg" strong>
                        {i.name}
                      </Text>
                    </div>
                    <div>
                      <TextDesc size="md">
                        {i.description && i.description}
                      </TextDesc>
                    </div>
                  </div>
                </StyledImageName>

                {/* Switch */}
                <Switch checked={i.checked} onChange={onChange} />

                {/* Delete button */}
                {showDeleteButton && (
                  <>
                    <StyledDivider orientation="vertical" />
                    <UnstyledButton
                      onClick={onDeleteClick}
                      disabled={!i.isDeletable}>
                      <Icon
                        size="md"
                        color={i.isDeletable ? 'error' : 'icon'}
                        type="delete"
                      />
                    </UnstyledButton>
                  </>
                )}
              </StyledItem>
            );
          })}
        </div>
      </>
    );
  };

  const getFooter = () => {
    return !isFormMode ? null : (
      <ModalFooterConfirmation
        okText="Save"
        okDisabled={isSubmitFormDisabled}
        handleCancel={() => setIsFormMode(false)}
        handleOk={onSubmitForm}
      />
    );
  };

  return (
    <GenericModal
      onClose={onClose}
      title={title}
      body={getBody()}
      footer={getFooter()}
      withoutBodyPadding
    />
  );
};

export default ManageList;
import React from 'react';
import styled from 'styled-components';

import { Button } from '../../index';

const FooterWrapper = styled.div`
  display: flex;
  justify-content: space-around;
`;

type Props = {
  okText?: string;
  cancelText?: string;
  okDisabled?: boolean;
  handleOk: () => void;
  handleCancel: () => void;
};

export const ModalFooterConfirmation = ({
  cancelText = 'Cancel',
  handleCancel,
  okDisabled,
  handleOk,
  okText = 'Confirm',
}: Props): React.ReactElement => {
  return (
    <FooterWrapper>
      <Button size="md" color="secondary" onClick={handleCancel}>
        {cancelText}
      </Button>
      <Button
        color="primary"
        size="md"
        variant="contained"
        onClick={handleOk}
        disabled={okDisabled}>
        {okText}
      </Button>
    </FooterWrapper>
  );
};
